import React, { useState } from 'react';
import './AddAnimal.css';

function AddAnimal() {
  const [animalName, setAnimalName] = useState('');
  const [animalSpecies, setAnimalSpecies] = useState('');
  const [animalGender, setAnimalGender] = useState('');
  const [animalDOB, setAnimalDOB] = useState('');
  const [animalEndangered, setAnimalEndangered] = useState('no'); // Default value set to 'no'
  const [animalOrigin, setAnimalOrigin] = useState('');
  const [animalLifeStage, setAnimalLifeStage] = useState('');
  const [animalDOA, setAnimalDOA] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    // Get the current date and time for Animal DOA
    const currentDate = new Date();
    const animalDOAValue = currentDate.toLocaleString();

    // Logging entered values
    console.log('Animal Name:', animalName);
    console.log('Animal Species:', animalSpecies);
    console.log('Animal Gender:', animalGender);
    console.log('Animal DoB:', animalDOB);
    console.log('Is Animal Endangered?', animalEndangered);
    console.log('Animal Origin:', animalOrigin);
    console.log('Animal Life Stage:', animalLifeStage);
    console.log('Animal DoA:', animalDOAValue); // Logging the current date as Animal DOA

    // Backend logic can be implemented here to send data inputs to the backend

    // Clearing form fields after submission
    setAnimalName('');
    setAnimalSpecies('');
    setAnimalGender('');
    setAnimalDOB('');
    setAnimalOrigin('');
    setAnimalLifeStage('');
  };

  const handleEndangeredChange = (event) => {
    setAnimalEndangered(event.target.value);
  };

  return (
    <div className="add-animal-container">
      <h2>Add Animal</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="animalName">Animal Name:</label>
          <input
            type="text"
            id="animalName"
            value={animalName}
            onChange={(e) => setAnimalName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalSpecies">Animal Species:</label>
          <input
            type="text"
            id="animalSpecies"
            value={animalSpecies}
            onChange={(e) => setAnimalSpecies(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalGender">Animal Gender:</label>
          <input
            type="text"
            id="animalGender"
            value={animalGender}
            onChange={(e) => setAnimalGender(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalDOB">Animal DoB:</label>
          <input
            type="date"
            id="animalDOB"
            value={animalDOB}
            onChange={(e) => setAnimalDOB(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalEndangered">Is Animal Endangered?</label>
          <select id="animalEndangered" value={animalEndangered} onChange={handleEndangeredChange} required>
            <option value="yes">Yes</option>
            <option value="no">No</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="animalOrigin">Animal Origin:</label>
          <input
            type="text"
            id="animalOrigin"
            value={animalOrigin}
            onChange={(e) => setAnimalOrigin(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="animalLifeStage">Animal Life Stage:</label>
          <input
            type="text"
            id="animalLifeStage"
            value={animalLifeStage}
            onChange={(e) => setAnimalLifeStage(e.target.value)}
            required
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default AddAnimal;
